import React, { useEffect } from "react";
import axios from "axios";

export default function Weather() {
  useEffect(() => {
    const apiKey = "ab8e7ef210556986d1c9a75d6007b825";
    const apiUrl = `https://api.openweathermap.org/data/2.5/weather?q=New%20York&appid=${apiKey}&units=metric`;

    axios.get(apiUrl).then((response) => {
      handleResponse(response);
    });
  }, []);

  function handleResponse(response) {
    alert(`The weather in New York is ${response.data.main.temp}°C`);
    // You can update state or perform other actions based on the response here
  }

  return <h2>Hello from Weather</h2>;
}
